import React from 'react';
import "./setting.css";
import "../../components/sidebar/SideBar";


const Setting = () => {
    return ( 
        <div className='settings'>
            <div className="settingWrapper"></div>
            <SideBar />
        </div>
     );
}
 
export default Setting;
